import './App.css';
import Header from './Header';
import Lists from './Lists';
import { useEffect, useState } from 'react';
import axios from 'axios';
function App() {
  const KEY = 'ac733e4361119585d5f69a529226d016';
  const targetDate = '20220917';

  const [data, setData] = useState('');
  // useEffect(()=>{
  //   axios.get(`http://www.kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=${KEY}&targetDt=${targetDate}`)
  //   .then(res=>setData(res.data.boxOfficeResult.dailyBoxOfficeList))
  //   console.log(data);
  // },[data]);


  const movieRank = {

    url:'http://www.kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json',
    method:'GET',
    params:{key:'ac733e4361119585d5f69a529226d016',
            targetDt:'20220917',},
    responseType:'json'

  }
  //const url = `http://www.kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=${KEY}&targetDt=${targetDate}`
  const getMovieRank = () => {
    axios(movieRank)
    .then((res)=>{
      const rankList = res.data.boxOfficeResult.dailyBoxOfficeList;
      console.log(rankList);
      setData(rankList);
    })
    .catch(error=>console.error(`Error:${error}`));
  }

  useEffect(() => {
    getMovieRank();
  }, [data]);


  return (
    <div>
      <Header></Header>
      <Lists data={data}></Lists>
    </div>    
  );
}

export default App;
